import React, { Component } from 'react';

import shareScreen from "../../pictures/sharescreen.png";
import stopShare from "../../pictures/stopshare.png";



class Page10 extends Component {

    state = {
        text: {}
    }
    
    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
    }
  
    render() {
        return (
            <div className="sheet">
                <h1 id="p10title" className="bold center">Sharing about mentoring</h1>
                <div id="page10" className="left container_for_medium_margin">
                    <p>
                        You have the option of sharing information about what we did in mentoring with someone who supports you.<br/>
                        Do you think you want to do that this week?  It’s your choice if you would like to share about what you’re learning, or not, with someone who you really trust like a family member, teacher, or counselor. If you do want to share, then I’ll have you fill out a short worksheet!  If you don’t want to share, that’s okay too!
                    </p>
                    <div className="custom_svg demo_box container_for_large_margin" id="instruction_box_number_1_page_10_sheet_5">
                        <p className="top_line_in_instruction_box">If your mentee wants to share, send them this link: </p>
                    </div>
                    <br/>
                    <div className='container_for_medium_margin'>
                        <div className="custom_svg demo_box" id="instruction_box_number_2_page_10_sheet_5">
                            <p className="top_line_in_instruction_box">Share your screen</p>
                        </div>
                        <img src={shareScreen} alt="Share screen" id="shareScreen10" />
                    </div>
                    
                    <div className='container_for_medium_margin'>
                        <div className="custom_svg demo_box container_for_extra_large_margin" id="instruction_box_number_3_page_10_sheet_5">
                            <h2 className="top_line_in_instruction_box">When you are finished, stop sharing your screen</h2>
                        </div>
                        <img src={stopShare} alt="Stop sharing" id="stopShare10" />
                    </div>
                </div>
            </div>
        )
    }
}
export default Page10;
